
-- USE x1Project77;

/*
------------------------------------------------------------------------------------------
------------------------------------TMI DATA TABLE----------------------------------------
*/

DROP TABLE IF EXISTS DATA_TMIAWARDS ;
CREATE TABLE DATA_TMIAWARDS ( id Serial , district VARCHAR(255) , club VARCHAR(255) , division VARCHAR(255) , area VARCHAR(255) , award VARCHAR(255) , awarddate DATE , member VARCHAR(255) , name VARCHAR(255) , location VARCHAR(255) , membersID bigint(40) unsigned , created TIMESTAMP DEFAULT CURRENT_TIMESTAMP , createdby VARCHAR(255) , updated TIMESTAMP DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP , updatedby VARCHAR(255) );
SELECT * FROM DATA_TMIAWARDS ;


/*
------------------------------------------------------------------------------------------
------------------------------------CLUB DATA TABLE-------------------------------------
*/

DROP TABLE IF EXISTS RECORDS_CLUBS ;
CREATE TABLE RECORDS_CLUBS ( id Serial , name VARCHAR(255) , email VARCHAR(255) , mobile VARCHAR(255) , tmiclubid VARCHAR(255) , suburb VARCHAR(255) , city VARCHAR(255) , country VARCHAR(255) , president VARCHAR(255) , vpeducation VARCHAR(255) , vpmembership VARCHAR(255) , vppublicrelations VARCHAR(255) , secretary VARCHAR(255) , sergeantatarms VARCHAR(255) , treasurer VARCHAR(255) , created TIMESTAMP DEFAULT CURRENT_TIMESTAMP , createdby VARCHAR(255) , updated TIMESTAMP DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP , updatedby VARCHAR(255) );
SELECT * FROM RECORDS_CLUBS ;


/*
------------------------------------------------------------------------------------------
------------------------------------CLUB LOCATIONS TABLE-------------------------------------
*/

DROP TABLE IF EXISTS RECORDS_MEETINGLOCATIONS ;
CREATE TABLE RECORDS_MEETINGLOCATIONS ( id Serial , clubsID bigint(40) unsigned , locationtype VARCHAR(255) , locationstatus VARCHAR(255) , company VARCHAR(255) , unit_level VARCHAR(255) , number VARCHAR(255) , streetname VARCHAR(255) , streettype VARCHAR(255) , suburb VARCHAR(255) , city VARCHAR(255) , postcode VARCHAR(255) , country VARCHAR(255) , created TIMESTAMP DEFAULT CURRENT_TIMESTAMP , createdby VARCHAR(255) , updated TIMESTAMP DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP , updatedby VARCHAR(255) );
SELECT * FROM RECORDS_MEETINGLOCATIONS ;

/*
------------------------------------------------------------------------------------------
------------------------------------CLUB MEETINGS TABLE-------------------------------------
*/

DROP TABLE IF EXISTS RECORDS_CLUBMEETINGS ;
CREATE TABLE RECORDS_CLUBMEETINGS ( id Serial , clubsID bigint(40) unsigned , meetinglocationsID bigint(40) unsigned , meetingdate DATE , status VARCHAR(255) , created TIMESTAMP DEFAULT CURRENT_TIMESTAMP , createdby VARCHAR(255) , updated TIMESTAMP DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP , updatedby VARCHAR(255) );
SELECT * FROM RECORDS_CLUBMEETINGS ;

/*
------------------------------------------------------------------------------------------
------------------------------------MEMBER TABLES------------------------------------------
*/

DROP TABLE IF EXISTS RECORDS_MEMBERS ;
CREATE TABLE RECORDS_MEMBERS ( id Serial , namefirst VARCHAR(255) , namemiddle VARCHAR(255) , namelast VARCHAR(255) , email VARCHAR(255) , mobile VARCHAR(255) , gender VARCHAR(255) , dateofbirth DATE , clubsID bigint(40) unsigned , currentclubs VARCHAR(255) , currentmember VARCHAR(255) , datejoinedtm DATE , objectives VARCHAR(255) , mentor VARCHAR(255) , tmiCustomerID bigint(40) unsigned , notes VARCHAR(255) , created TIMESTAMP DEFAULT CURRENT_TIMESTAMP , createdby VARCHAR(255) , updated TIMESTAMP DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP , updatedby VARCHAR(255) );
SELECT * FROM RECORDS_MEMBERS ;


DROP TABLE IF EXISTS RECORDS_MEMBER_UNAVAILABILITY ;
CREATE TABLE RECORDS_MEMBER_UNAVAILABILITY ( id Serial , membersID bigint(40) unsigned , rolesID bigint(40) unsigned , startdate DATE , enddate DATE , created TIMESTAMP DEFAULT CURRENT_TIMESTAMP , createdby VARCHAR(255) , updated TIMESTAMP DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP , updatedby VARCHAR(255) );
SELECT * FROM RECORDS_MEMBER_UNAVAILABILITY ;

DROP TABLE IF EXISTS RECORDS_QUALIFICATIONS ;
CREATE TABLE RECORDS_QUALIFICATIONS ( id Serial , membersID bigint(40) unsigned , qualificationsID bigint(40) unsigned , qualificationdate DATE , qualificationstatus VARCHAR(255) , created TIMESTAMP DEFAULT CURRENT_TIMESTAMP , createdby VARCHAR(255) , updated TIMESTAMP DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP , updatedby VARCHAR(255) );
SELECT * FROM RECORDS_QUALIFICATIONS ;


DROP TABLE IF EXISTS RECORDS_PROJECTS ;
CREATE TABLE RECORDS_PROJECTS ( id Serial , membersID bigint(40) unsigned , qualificationsID bigint(40) unsigned , projectsID bigint(40) unsigned , rolesID bigint(40) unsigned , itemstatus VARCHAR(255) , projectdate DATE , created TIMESTAMP DEFAULT CURRENT_TIMESTAMP , createdby VARCHAR(255) , updated TIMESTAMP DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP , updatedby VARCHAR(255) );
SELECT * FROM RECORDS_PROJECTS ;

